ELEMENTS.Lights = function( parent, light, x, y, z ) {
    light = light || new THREE.PointLight( 0xFFFFFF, 1 );
    x = x || 0;
    y = y || 0;
    z = z || 0;
    light.position = new THREE.Vector3( x, y, z );
    light.name = "light";
    parent.add( light );
    return light;
};

